sp_angular_provider.script:
function () {
    return {
        template: '<button  id="backBtn" class="btn btn-primary goBack" ng-click="goBack()">' +
            '<i class="fa fa-arrow-circle-left"></i>' +
            '</button>',
        controller: function($scope) {
            $scope.goBack = function() {
                 window.history.back();
            };
        }
    }
}
